import React from 'react';
import Data from './resource_list';

const ResourceCard = ({ resource }) =>{
    return(
        <div className="resource">
          <div>
            <p>{resource.Type}</p>
          </div>
          <div>
            <img src={resource.image !== 'N/A' ? resource.image: 'https://via.placeholder.com/400'} alt = {resource.Name}/>
          </div>

          <div>
            <span>{resource.Type}</span>
            <h3>{resource.Name}</h3>
          </div>

        </div>
    );
}
export default ResourceCard;
